import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            result: []
        }
    }
    componentDidMount() {
        fetch("http://localhost:8080/Posts_war_exploded/api/posts")
            .then( result => {
                this.setState({result: result.json()})
            })
    }

    render() {
    return (
      <div className="App">
        <header className="App-header">
        </header>
          <p>
              {this.state.result}
          </p>
      </div>
    );
  }
}

export default App;
